// client/src/pages/Home.js
import React, { useState } from 'react';
import SearchForm from '../components/SearchForm';

const Home = () => {
  const [lastSearch, setLastSearch] = useState(null);
  
  const handleSearchComplete = (search) => {
    setLastSearch(search);
    console.log('Busca iniciada:', search);
  };
  
  return (
    <div className="home-container">
      <div className="sidebar">
        <SearchForm onSearchComplete={handleSearchComplete} />
        
        <div className="recent-searches">
          <h3>Buscas Recentes</h3>
          {lastSearch ? (
            <div className="search-info">
              <p>Última busca: {lastSearch.query}</p>
              <p>Status: {lastSearch.status}</p>
            </div>
          ) : (
            <p>Nenhuma busca realizada</p>
          )}
        </div>
      </div>
      
      <div className="main-content">
        <div className="business-list">
          <div className="list-header">
            <h2>Empresas Encontradas</h2>
          </div>
          
          <div className="business-table">
            <p>Aguardando conclusão da busca...</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Home;
